INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(1, 2, 'Carla\'s Dreams', , 'Carla’s Dreams is one of the most nonconformist projects in the music industry, with versatile songs, strong messages and diverse themes. They have millions of fans, dozens of hits, hundreds of millions of views and hundreds of concerts. The band offers its public, which they share a special connection with, a unique experience with every concert. Carla’s Dreams songs always become viral almost immediately and their fans can hear them all over radio and TV, where they stay on the first positions for weeks. After selling out 3 concerts at Arenele Romane, the band moved on to the next level: Romexpo - a bigger location, different concept, more led screens, special effects and a sound to match it all. The song “Sub pielea mea #Eroina” became one of the most appreciated songs of Carla’s Dreams, conquering Ukraine, Russia and reaching #11 on Shazam worldwide, surpassing P!nk, Coldplay and Florence + The Machine. Carla’s Dreams’ portfolio also includes “Nocturn”, a project that contains 6 short-histories, told by 6 characters in approximately 200 days. 13 songs were launched, among them ”Luna”, ”Dependent” with Deliric, ”Anxietate” with Antonia, together with a few testimonials and other materials.', '2022-10-02');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(2, 3, 'The Motans', , 'The Motans is an incredibly well-known artist in the Romanian landscape, acknowledged for his catchy, yet filled with meaning songs. The majority of the artist’s releases are instantly loved by the public, as well as supported by radios and TV channels around the country. Most of his tracks have reached Top 10 in all mainstream tops, including the MediaForest Radio Airplay chart where The Motans is almost always present. Some of his most well-known releases are POEM, ISNFN, Versus, August, Jackpot, Weekend feat. Delia, Pentru Ca feat. INNA, Nota de Plata feat. INNA, Din Trecut feat. Alina Eremia and the list goes on. The artist’s live performance is every bit as piercing as his tracks, The Motans is truly a rockstar!', '2022-10-04');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(3, 1, 'Avicii', , 'Tim Bergling, known professionally as Avicii is a Swedish DJ, remixer and music producer. At the age of 16, Bergling began posting his remixes on electronic music forums, which led to his first record deal.He rose to prominence in 2011 with his single \"Levels\". His debut studio album, True (2013), blended electronic music with elements of multiple genres and received generally positive reviews. It peaked in the top 10 in more than 15 countries and topped international charts; the lead single, \"Wake Me Up\", topped most music markets in Europe and reached number four in the United States.\r\n\r\nIn 2015, Bergling released his second studio album, Stories, and in 2017 he released an EP, Avīci (01). His catalog also included the singles \"I Could Be the One\" with Nicky Romero, \"You Make Me\", \"X You\", \"Hey Brother\", \"Addicted to You\", \"The Days\", \"The Nights\", \"Waiting for Love\", \"Without You\" and \"Lonely Together\". Bergling was nominated for a Grammy Award for his work on \"Sunshine\" with David Guetta in 2012 and \"Levels\" in 2013. Several music publications credit Bergling as among the DJs who ushered electronic music into Top 40 radio in the early 2010s.', '2022-10-01');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(4, 4, 'Martin Garrix', , 'Martin Garrix is a Dutch DJ and record producer who was ranked number one on DJ Mag\'s Top 100 DJs list for three consecutive years—2016, 2017, and 2018. He is best known for his singles \"Animals\", \"In the Name of Love\", and \"Scared to Be Lonely\".\r\n\r\nGarrix has performed at music festivals such as Coachella, Electric Daisy Carnival, Ultra Music Festival, Tomorrowland, and Creamfields. In 2014, he headlined the first edition of Ultra South Africa, making this his first major festival. In the same year, he became the youngest DJ to headline 2014 Ultra Music Festival at the age of 17. He was a resident DJ at Spain\'s Hï Ibiza (2017) and Ushuaïa Ibiza (2016 and 2018). He founded the label Stmpd Rcrds in 2016, months after leaving Spinnin\' Records and before signing with Sony Music.', '2022-10-27');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(5, 1, 'Sandro Cavazza', , 'Sandro Cavazza is the stage name of Swedish singer-songwriter Alessandro Michele Cavazza (born on September 11, 1992), mostly known for lending his voice to several hit songs by DJ and producer Avicii. He was also a member of pop group Estraden before launching his career as a solo artist. Cavazza made his first appearance on Avicii’s 2015 singles “Sunset Jesus” and “Gonna Love Ya,” which peaked at Number 3 on the Swedish charts. \"Beautiful Life,\" his 2016 collaboration with Belgian DJ Lost Frequencies became a Number 1 hit on Belgium’s Ultratop charts and he scored yet another chart-topper with Avicii’s “Without You” in 2017. That same year, an Avicii remix of the song “So Much Better,” included in Cavazza’s eponymous debut EP, reached Number 12 on the Sverigetopplistan. Further single “High With Somebody” (2018) featuring P3GI-13, entered the Swedish Top 10 as he made an appearance on Kygo’s “Happy Now,” which made it to Number 3 in his native country. Preceded by the singles “Sad Child” and “Lean on Me,” Weird & Talkative, his second extended-player, saw the light in 2020.', '2022-10-02');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(6, 2, 'Kygo', , 'Whether behind the piano in his studio or headlining a sold-out festival, Kygo quietly reaffirms his status as a prodigious talent, forward-thinking producer, dynamic DJ, and influential global superstar. The Norwegian musician born Kyrre Gørvell-Dahll first introduced himself in 2013 and quietly became one of the most ubiquitous hitmakers in the world. Amassing 23 billion cumulative global audio and video streams by 2022, he has broken numerous streaming records. Kygo earned one of his biggest hits with the multiplatinum “It Ain’t Me” (feat. Selena Gomez), going Top 10 on the Billboard Hot 100 and clocking over 2.9 billion streams worldwide. In 2019, Kygo unleashed “Higher Love” with Whitney Houston and generated another 1.4 billion combined streams/views worldwide and peaked at #1 on Dance Radio, in addition to leaving his imprint on a classic.\r\n\r\nHe heralded his 2020 critically acclaimed third full-length album Golden Hour [Sony Music International/Ultra Records/RCA Records] with the anthems “Like It Is” (feat. Zara Larsson & Tyga), “Lose Somebody” (with OneRepublic), and “I’ll Wait” (feat. Sasha Alex Sloan). The album has garnered over 2.5 billion streams worldwide. Following Golden Hour, Kygo released his remix of Tina Turner’s “What’s Love Got To Do With It” and Donna Summer’s “Hot Stuff” to rave reviews. After headlining Lollapalooza and Life Is Beautiful this summer, along with sold-out headlining shows at Madison Square Garden and Oslo’s Ullevaal Stadion, this fall Kygo surprised fans with the release of his fourth album Thrill Of The Chase [RCA Records]. The album featured notable singles including “Dancing Feet” (feat. DNCE), “Woke Up In Love” (with Gryffin feat. Calum Scott), and “Never Really Loved Me” (feat. Dean Lewis), amassing over 700 million streams worldwide and debuting in the Top 5 on the Billboard Top Dance/Electronic Albums Chart.', '2022-10-02');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(7, 3, 'Lost Frequencies', , 'Lost Frequencies is the stage name used by Belgian producer and DJ Felix De Laet. Born in Brussels on November 30, 1993, De Laet used the term \'Lost Frequencies\' to refer to some of the old tracks he was remixing and decided the name would work well for his new project. His first major success was a reworking of a 2012 song by the American country artist Easton Corbin titled “Are You with Me.” He took Corbin\'s song and with a light touch turned it into an uptempo modern track. The single rocketed up the charts in 2014 reaching Number 1 in several European countries and launched Lost Frequencies’ career to a European-wide audience. His debut studio album Less Is More was released in 2016 and contained the follow-up single “Reality,” which became a huge hit throughout Europe firmly establishing him as a major talent within the house music scene. After starting his own label Found Frequencies, a subsidiary of Armada Music, Lost Frequencies dropped his highly-anticipated second album Alive and Feeling Fine in 2019. Featuring guest spots by James Blunt (“Melody”), Aloe Blacc (“Truth Never Lies”), and Zonderling (“Crazy”), the full-length climbed to Number 6 in his native Belgium and many of its singles were certified gold. In the following years, Lost Frequencies dropped an EP titled Cup of Beats (2020) and released the 2021 single “Rise,” which peaked at Number 18 on Belgium’s Ultratop chart.', '2022-10-05');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(8, 4, 'Tiësto', , 'A superstar DJ and the toast of Europe\'s club scene for two decades, Tiësto has remixed for the biggest artists in the world and established himself as one of dance music\'s most successful brands. Born in Breda, Holland, Tijs Michiel Verwest (aka Tiësto) started out playing house records at clubs in his home town before producing his own hardcore tracks and starting the label Black Hole Recordings. Making his name at Sheffield\'s famed Gatecrasher club night, he became one of the leading trance DJs in the late 1990s and his remix of Delirium\'s single Silence (featuring Sarah McLachlan) gave him his first Top 10 hit in the UK. Debut album In My Memory (2001) was full of hypnotic beats and euphoric anthems, but it was third album Elements Of Life (2007) that made the major commercial breakthrough, reaching Number 14 and earning a Grammy Award nomination. Going on to play at Ibiza\'s superclubs and performing all over the world, he played at the opening ceremony of the 2004 Olympics in Athens and was voted the Greatest DJ Ever by Mixmag magazine in 2011. Artist biography compiled by BDS/West 10.', '2022-10-28');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(9, 5, 'David Guetta', , 'Starting out DJ-ing and promoting his own club nights around France in the late 1980s, David Guetta (November 7, 1967) was given an early break when he talked Chicago house legend Robert Owens into recording vocals on what became the small hit \"Up and Away\" in 1994. Forming Gum Productions in 2001, his reputation continued to grow with the club anthem \"Just a Little More Love\" and a hugely popular electro-clash remix of David Bowie\'s \"Heroes\" called \"Just for One Day.\" In 2006 his mash-up of his own track \"Love Don\'t Let Me Go\" with The Egg\'s \"Walking Away\'\" gave Guetta a Number 3 single in the UK, before he scored massive success with fourth album One Love (2007). Reaching Number 2 in the UK, it featured chart-topping singles \"When Love Takes Over\" with Kelly Rowland and \"Sexy Bitch/Sexy Chick\" with Akon and sealed his status as a superstar DJ and highly sought-after producer. In 2009 David Guetta produced The Black Eyed Peas\' Number 1 hit single \"I Gotta Feeling,\" which became the most downloaded song in history and earned him a Grammy nomination for Record of the Year. He also co-wrote and produced Kelly Rowland\'s single \"Commander\" which peaked at Number 1 on Billboard\'s Hot Dance Club Songs Chart. He released his fifth album Nothing But the Beat in 2011 and starred in a biographical documentary of the same name. In 2012 he started his own record label Jack Back Records to enable him to veer away from dance to focus on electronic music. He continued to tour, perform and collaborate with big names including Rihanna, Lady Gaga, Britney Spears, and Emeli Sandé before releasing his sixth record Listen. Guests on the album included Sia, Nicki Minaj, The Script, and Afrojack with the title track featuring John Legend. His seventh album, titled 7, was released in 2018 and featured collaborations with Justin Bieber, Jess Glynne, and Martin Garrix. After releasing the collaborative EP New Rave with Danish DJ Morten in 2020, David Guetta performed a handful of highly-publicized virtual shows at New York City’s Top of the Rock Observation Deck at Rockefeller Center and the Louvre Museum during the coronavirus pandemic. In 2021, he returned with a remix of One Love\'s “Memories” that broke into the German Top 100.', '2022-10-30');
INSERT INTO `lineups` (`lineup_ID`, `stage_ID`, `lineup_name`, `lineup_avatar`, `lineup_about`, `lineup_day_playing`) VALUES
(10, 5, 'Calvin Harris', , 'Bedroom producer turned chart master of catchy disco pop, Dumfries-born Calvin Harris made his first bid for stardom releasing 12-inch club tracks under the name Scouffer in 2002. Minor success led to a move to London, but it wasn\'t until he was back home in Scotland posting songs on MySpace that he attracted the attention of EMI. The singles \'Acceptable in the 80s\' and \'The Girls\' became electro-clash summer anthems in 2007, paving the way for debut album \'I Created Disco\'. His production skills and ear for a pop hook quickly became hot property, with artists like Jamiroquai, CSS, All Saints and Groove Armada queuing up for remixes, and Kylie Minogue even recruiting him to write and produce two tracks for her album \'X\'.\r\n', '2022-10-31');

